            after_selected: (selected) => $('.add').attr('disabled', Object.keys(selected).length < 1)
        });

        create_selective_list({
            selector : $('#right'),
            kvdb     : dataset.right,
            side     : 'right',
            page_size: 15,
            after_selected: (selected) => $('.del').attr('disabled', Object.keys(selected).length < 1)
        });

        $('#filter').keyup((e) => {
            var $search = $(e.target);
            var $list   = $('#left > .list');

            $list.data('unselect')();

            $list.data('load_list')({
                page  : 1,
                search: $search.val(),
                then  : (args) => {
                    $search.focus();
                }
            });
        });

        $('.add').click(() => {
            var $left    = $('#left  > .list');
            var $right   = $('#right > .list');
            var selected = $left.data('get_selected')();
            var values   = Object.keys(selected);
            if (values.length == 0) {
                return;
            }
            var moving_items = dataset.left.delete_items(values);
            dataset.right.add_items(moving_items);
            $left.data('unselect')();
            $right.data('select')(moving_items.map((row) => row.value));
            $left.data('load_list')({then: () => $right.data('load_list')({page: 'last'})});
        });

        $('.del').click(() => {
            var $left    = $('#left  > .list');
            var $right   = $('#right > .list');
            var selected = $right.data('get_selected')();
            var values   = Object.keys(selected);
            if (values.length == 0) {

            }
            var moving_items = dataset.right.delete_items(values);
            dataset.left.add_items(moving_items);
            $right.data('unselect')();
            $left.data('select')(moving_items.map((row) => row.value));
